import React, { useState , useEffect } from "react";
import axios from 'axios';


const urlBirthday = process.env.URL_SERVER;
const [birthdayState , setBirthdayState] = useState({})

export default function Birthday() {

    useEffect(() => {
        console.log(birthdayState);
        try {
            console.log(urlBirthday)
            const{data} = axios.get(`${urlBirthday}api/getBirthday`);
            setBirthdayState = data.data
            return(birthdayState)
         } catch (error) {
             console.log(error)
         }
    }, [])
    return(
        <div>Birthday</div>
    )
}
